(defn calc-nmi-for-Iris
  [candidate-sequence]
  (calc-nmi candidate-sequence y))

(defn calc-average-time-and-nmi
  [model number-of-sample-sequencies number-of-particles]
  (let
    [time-and-nmis (get-evaluation-result-and-time (draw-sample-sequencies model number-of-sample-sequencies number-of-particles))]
    (list (first time-and-nmis) (average (map calc-nmi-for-Iris (second time-and-nmis))))))

;; http://stackoverflow.com/questions/30775032/transpose-a-matrix-in-racket-list-of-lists
(defn transpose [xss]
  (apply map list xss))
