(defn plot-compose
  [data-sequencies colours]
  (let
    [global-min (apply min (apply concat data-sequencies))
     global-max (apply max (apply concat data-sequencies))]
    (apply plot/compose (map (fn [data-seq colour] (plot/histogram data-seq :colour colour :plot-range [[global-min global-max] :all])) data-sequencies colours))))
